css:
atom-text-editor,
:host {
  background-color: #252934;
  color: #a7adba;
}
atom-text-editor .invisible-character,
:host .invisible-character,
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #4f5b66;
}
atom-text-editor .gutter,
:host .gutter {
  min-width: .3em;
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  opacity: 1;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #ab7967;
}
atom-text-editor .cursor,
:host .cursor {
  border-color: #eff1f5;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #343d46;
  color: #252934;
}
atom-text-editor .line-number.cursor-line-no-selection,
:host .line-number.cursor-line-no-selection {
  background-color: #4f5b66;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #343d46;
}
.bracket-matcher .region {
  background-color: #c0c5ce;
  opacity: 0.25;
}
.comment {
  color: #4f5b66;
}
.entity:not(.js) {
  color: #d08770;
}
.keyword {
  color: #b48ead;
}
.storage.type {
  color: #b48ead;
}
.constant {
  color: #ebcb8b;
}
.constant.numeric,
.constant.boolean {
  color: #d08770;
}
.variable {
  color: #8fa1b3;
}
.delimiter,
.brace {
  color: #a7adba;
}
.delimiter.period {
  color: #a3be8c;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #bf616a;
}
.invalid.illegal {
  color: #bf616a;
}
.string {
  color: #a3be8c;
}
.string .constant.character.escape {
  color: #a7adba;
}
.string.regexp {
  color: #96b5b4;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #bf616a;
}
.markdown-preview {
  color: #a7adba !important;
  background-color: #2b303b !important;
}
.markdown-preview h1,
.markdown-preview h2,
.markdown-preview h3,
.markdown-preview h4,
.markdown-preview h5,
.markdown-preview h6 {
  border-bottom: none !important;
}
.markdown-preview code {
  background-color: rgba(0, 0, 0, 0.2) !important;
}
